import React from "react";

function FetchPage(){
    fetch("http://jsonplaceholder.typicode.com/posts/1")
        .then( res => res.json())
        .then( res => {
            if (res.success) {
                  console.log(`${res.suer.title}`);  
            }
        }) 
};

export default FetchPage;
